import React from 'react'

const landingPage = () => {

    const headerStyle = {
        color: '#483D53',
        fontSize: '50px'
    }

    const buttonStyle = {
        backgroundColor: '#483D53',
        color: '#FFFFFF',
        boxShadow: '2px 3px 3px 2px black',
        border: 'none',
        textAlign: 'center',
        display: 'inline-block',
        padding: '15px 32px',
        fontSize: '16px',
        textDecoration: 'none'
    }

    return (
        <div>
            <h1 style={headerStyle}>
                SnapCode
            </h1>
            <button style={buttonStyle}>
                Get Started!
            </button>
        </div>
    )
}

export default landingPage;
